message:
Os sinais para o Brasil, sob o novo governo, apontam neste momento para:

- Economia crescentemente engessada, a pretexto de reorganizá-la;

- Ataque sistemático contra a segurança dos cidadãos comuns, com o claro intuito de fabricar problemas para vender soluções custosas e inúteis, perpetuando o ciclo de dependência da sociedade em relação a agentes estatais e para-estatais que são um fim em si mesmos;

- Instabilidade jurídica promovida por um poderes ilegítimos e hipertrofiados;

- Establishment governamental com folha corrida, tirando qualquer credibilidade e legitimidade de seus representantes, que apelam para truculência crescente em seus pronunciamentos públicos;

- Sinalização de submissão a normas internacionais que atingem diretamente o maior capital que um país pode possuir: o humano, através de ações na saúde e educação públicas;

- Obsessão com a formação de um pseudo-bloco sul-americano, onde o Brasil teria que sustentar países falidos e culturalmente diferentes, em uma ação sem qualquer sentido para os interesses nacionais. O pretexto, claro, é a integração que induziria o crescimento de setores econômicos brasileiros, formação de mercados e a projeção de poder nacional. Na prática, contudo, deve servir apenas para direcionar a economia, aumentar o controle estatal e entregar os recursos brasileiros para esquemas financeiros transnacionais;

-  E, além do horizonte descrito acima,como pano de fundo em todas as medidas tomadas ou aventadas, temos uma pauta de engenharia social de cunho eugenista e satanista, que pode ser facilmente implantada dado o grau de autoritarismo governamental, sob o olhar indiferente dos poderes constituídos. Em outras palavras, a elite brasileira está a serviço de agendas que em última análise são totalmente anti-população.

E parece muito pouco provável que os movimentos que retiram o Brasil de organismos econômicos globalistas, medida que agrada setores nacionalistas, são parte de uma pauta genuinamente desenvolvimentista, estando muito mais para um mero ajuste destino a centralização econômica, e assim servir melhor determinados grupos internacionais, para quem o Brasil é uma imensa reserva de exploração.

Paulo Vinicius
